import React from 'react';
import logo from '../images/logo.png';

const Footer = () => {
  return (
    <footer className="py-8 bg-gradient-to-r from-black to-gray-700 text-white h-[600px]">
      <div className="container mx-auto flex border flex-col lg:flex-row justify-between items-center">
        <div className="flex items-center mb-4 lg:mb-0">
          <img src={logo} alt="Logo" className="h-10 w-auto" />
        </div>

        <div className="flex flex-col lg:flex-row items-center justify-center">
          <div className="mb-4 lg:mb-0">Column 1 Text</div>
          <div className="mb-4 lg:mb-0">Column 2 Text</div>
          <div className="mb-4 lg:mb-0">Column 3 Text</div>
          <div className="mb-4 lg:mb-0">Column 4 Text</div>
        </div>
      </div>

      {/* Copyright Text */}
      <div className="text-center text-sm mt-4">Copyright 2023</div>
    </footer>
  );
};

export default Footer;
